import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Open a product modal by clicking a product card using a unique product title text
    // We'll use the first .product-card with text 'Apple iPhone 15 Pro Max'
    const productCardSelector = "//div[contains(@class, 'product-card')]//h3[contains(text(), 'iPhone 15 Pro Max')]/ancestor::div[contains(@class, 'product-card')]";
    await page.waitForSelector(productCardSelector, { timeout: 5000 });
    const productCard = await page.$(productCardSelector);
    if (!productCard) throw new Error('Product card not found');
    await productCard.click();

    // Wait for the modal to appear by waiting for the modal-content with a product-detail-title
    const modalTitleSelector = "//div[contains(@class, 'modal-content')]//h2[contains(@class, 'product-detail-title') and contains(text(), 'iPhone 15 Pro Max')]";
    await page.waitForSelector(modalTitleSelector, { timeout: 5000 });

    // Take screenshot of modal open
    const modalOpenShot = path.join(screenshotsDir, 'step_2_modal_open.png');
    await page.screenshot({ path: modalOpenShot });
    screenshots.push(modalOpenShot);

    // Press Escape to close the modal
    await page.keyboard.press('Escape');

    // Wait for modal to disappear (modal-content should be detached)
    await page.waitForSelector(modalTitleSelector, { state: 'detached', timeout: 5000 });

    // Take screenshot after modal closed
    const modalClosedShot = path.join(screenshotsDir, 'step_3_modal_closed.png');
    await page.screenshot({ path: modalClosedShot });
    screenshots.push(modalClosedShot);

    // Extract data to verify modal is closed (modal-content with product title should not be visible)
    const modalStillVisible = await page.$(modalTitleSelector);

    return {
      success: !modalStillVisible,
      action: "Opened a product modal and closed it with Escape key",
      extractedData: {
        modalClosed: !modalStillVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
